import React from 'react';
import {NoteType} from '../types/notesTypes'
import TableItem from './TableItem';
import '../styles/Table.css';
import { getNoteCells } from '../utils/otherUtils';
import HeaderTable from './HeaderTable';

interface TableProps {
  notes: NoteType[],
  children: string,
}


const Table: React.FC<TableProps> = ({
    notes,
    children
  }) => {


  return (
    <div className='notes'>
        <h2>{children}</h2>

        <HeaderTable type='small'/>
        {notes.map((note) => 
          <TableItem typeTable='blueRow active' cells={getNoteCells(note)} addButtons={true}/>
        )}
    </div>
  );
}
  
  
export default Table;
